import coin from '../../images/coin.png';

function Guadagni(props) {
  console.log(props.dataHero);
  const hero = props.dataHero;

  const battaglieRimanenti = hero.heroRanking.totalBattleCapTHC - hero.heroRanking.battleCapTHC;

  const guadagnoPotenziale = (hero.thcBonus + 6) * battaglieRimanenti;
  const profittoPotenziale = guadagnoPotenziale - hero.sale.price.value;


  let info = [];
  if(hero) {
      info = [
        {
            value: guadagnoPotenziale,
            name: "Guadagno Potenziale"
        },
        {
            value: profittoPotenziale,
            name: "Profitto Potenziale"
        }
      ]
  }
  return (
      <div>
          {
              hero ? 
              info.map((data) => {
                  console.log(data)
                return (
                  <div class="mainLayout flexSpace marginTop10 maxWidth350">
                  <div><h3>{data.name}</h3></div>
                  <div class="resultLabel">
                    <div class="guadagnoLabel">
                      <h3 id="profittoPotenziale">{data.value} THC</h3>
                      <div class="usd" id="profittoPotenzialeUSD">{data.usd} USD</div>
                    </div>
                    <div style={{backgroundImage: "url("+coin+")"}} class="thc"></div>
                  </div>
                </div>
                )
            })
              : <div>"NIENTE"</div>
          }
      </div>

  );
}

export default Guadagni;
